import React from 'react'
import '../index.scss'

function NotFound(){
    return (
        <div className="notfound">
            <h1>Splitkaro</h1>
            <p>404. That’s an error.</p>
            <p>The requested URL was not found on this server.</p>
            <p>That’s all we know.</p>
        </div>
    )
}

export default NotFound
